import React from 'react';
import {ENGLISH} from '../../actions/languageActions';
const SignUp = ({language}) => {
    return (
        <div class="form sign-up">
            <h2>import {ENGLISH} from '../../actions/languageActions';Time to feel like home</h2>
            <label>
                <span>Email</span>
                <input type="email" />
            </label>
            <label>
                <span>Password</span>
                <input type="password" />
            </label>
            <label>
                <span>Check  password</span>
                <input type="password" />
            </label>
            <button type="button" class="submit">Sign Up</button>
        </div>
    )
}
export default SignUp;
